  false,\n\t\"url\": null,\n\t\"notes\": \"Relic sediment deposits within the Goleta
  Slough, Carpinteria Salt Marsh, Ormond Beach wetlands, and Mugu Lagoon contain unknown
  reserves of sand that may present opportunities for one time or more regular beach
  nourishments. The Goleta Slough is already being regularly dredged by Santa Barbara
  County to remove significant volumes of sediment that accumulates within the slough
  channels. The feasibility of extracting beach compatible sand from the other environmentally
  sensitive areas is subject to further study and review.\",\n\t\"license_title\":
